import React from "react";
function Temp() {
  return (
    
      <div className="box">
        <div className="heading">
          <h1>Weather App</h1>
          <div className="image">
            <img
              src="https://cdn.icon-icons.com/icons2/2211/PNG/512/weather_sun_sunny_cloud_icon_134157.png"
              height={35}
              width={33}
            />
          </div>
        </div>

        <form className="inputField">
          <input type="search" name="inputBox" />
          <button type="submit">
            <i class="fa-solid fa-magnifying-glass"></i>
          </button>
        </form>
        <div className="text">
          <h1>Kolkata</h1>
          <h2>26° cel</h2>
          <p>max : 31°cel | min: 23°cel</p>
        </div>
      </div>
    
  );
}
export default Temp;
